import React from 'react'
import { Link } from 'react-router-dom'



const Navigation = () => {
  return (
    <>
    
       <section className='NavBg d-none d-lg-block'>
          <div className='container py-3 d-flex justify-content-between align-items-center'>
              <div>
                {/* <Link className='text-decoration-none logo text-white' to="#">Web Development</Link> */}
                <Link className='text-decoration-none logo text-white fw-bolder' to="#">LearnCoding</Link>
              </div>
         
              <nav>
                <ul className='d-flex list-unstyled mb-0'>
                    <li className='px-4'><Link className='text-decoration-none navItem' activeClassName="activeItem" to="./">Home</Link></li>
                    <li className='px-4'><Link className='text-decoration-none navItem' activeClassName="activeItem" to="./About">About</Link></li>
                    <li className='px-4'><Link className='text-decoration-none navItem' activeClassName="activeItem" to="./Courses">Courses</Link></li>
                    <li className='px-4'><Link className='text-decoration-none navItem' activeClassName="activeItem" to="./Placements">Placements</Link></li>
                    <li className='px-4'><Link className='text-decoration-none navItem' activeClassName="activeItem" to="./Contact">Contact</Link></li>
                </ul>
              </nav>
         
              <div>
                <ul className='d-flex list-unstyled mb-0 ps-0'>
                    <li className='px-3'><Link to="#"><i class="iconSize text-white facebook-color fa-brands fa-facebook-f"></i></Link></li>
                    <li className='px-3'><Link to="#"><i class="iconSize text-white insta-Color fa-brands fa-instagram "></i></Link></li>
                    <li className='px-3'><Link to="#"><i class="iconSize text-white twitter-color fa-brands fa-twitter"></i></Link></li>
                </ul>
              </div>
          </div>
       </section>

       se

    </>
  )
}


      function openNav() {
        document.getElementById("mySidenav").style.width = "257px";
      }
      
      function closeNav() {
        document.getElementById("mySidenav").style.width = "0";
      }

export default Navigation;
